// src/components/MenuList.jsx
import React from "react";

const dietaryIcons = {
  vegan: "üå±", vegetarian: "ü•ó", glutenfree: "üö´üåæ",
};

const allergenIcons = {
  Celery: "ü•¨", Gluten: "üåæ", Crustaceans: "ü¶ê", Eggs: "ü•ö", Fish: "üêü",
  Lupin: "üå∏", Milk: "ü•õ", Molluscs: "üêö", Mustard: "üåø", Nuts: "üå∞",
  Peanuts: "ü•ú", Sesame: "‚ö™", Soy: "üå±", Sulphites: "üí®",
};

function isUnsafe(dish, filters) {
  const selectedAllergens = Object.entries(filters)
    .filter(([key, val]) => val && allergenIcons[key])
    .map(([key]) => key.toLowerCase());

  const dishAllergens = (dish.Allergens || "")
    .split(",")
    .map((a) => a.trim().toLowerCase());

  return selectedAllergens.some((a) => dishAllergens.includes(a));
}

export default function MenuList({ items, filters, search, showHidden }) {
  const grouped = {};

  items.forEach((dish) => {
    const cat = dish.Category || "Other";
    if (!grouped[cat]) grouped[cat] = [];

    const matchesSearch = search
      ? `${dish.Name} ${dish.Ingredients} ${dish.Notes}`.toLowerCase().includes(search.toLowerCase())
      : true;

    const matchesDiet = ["vegan", "vegetarian", "glutenfree"].every((tag) =>
      filters[tag] ? (dish["Dietary Tags"] || "").toLowerCase().includes(tag) : true
    );

    const unsafe = isUnsafe(dish, filters);

    const shouldShow = matchesSearch && matchesDiet && (!unsafe || showHidden);

    if (shouldShow) {
      grouped[cat].push({ ...dish, _unsafe: unsafe });
    }
  });

  return (
    <div className="px-4 pb-32">
      {Object.entries(grouped).map(([category, dishes]) => (
        <div key={category} className="mb-8">
          <h2 className="text-xl font-bold text-teal-800 mb-3">{category}</h2>
          {dishes.length === 0 ? (
            <p className="text-sm text-gray-500 italic">No dishes match your filters.</p>
          ) : (
            <div className="space-y-4">
              {dishes.map((dish) => (
                <div
                  key={dish.Name}
                  className={`p-4 rounded-xl shadow border transition ${
                    dish._unsafe
                      ? "bg-gray-100 text-gray-400 border-gray-300 opacity-60"
                      : "bg-white text-gray-800"
                  }`}
                >
                  <div className="flex justify-between items-center">
                    <h3 className="text-lg font-semibold">{dish.Name}</h3>
                    <span className="text-sm font-medium">‚Ç¨{dish.Price}</span>
                  </div>
                  <p className="text-sm">{dish.Ingredients}</p>

                  {/* Dietary */}
                  {dish["Dietary Tags"] && (
                    <div className="text-sm mt-2 text-green-700">
                      <span className="font-medium">üå± Dietary: </span>
                      {dish["Dietary Tags"]
                        .split(",")
                        .map((tag) => tag.trim().toLowerCase())
                        .map((tag) => (
                          <span key={tag} className="inline-block mr-2">
                            {dietaryIcons[tag] || "‚úÖ"} {tag}
                          </span>
                        ))}
                    </div>
                  )}

                  {/* Allergens */}
                  {dish.Allergens && dish.Allergens.toLowerCase() !== "none" && (
                    <div className="text-sm mt-1 text-red-700">
                      <span className="font-medium">‚ö†Ô∏è Allergens: </span>
                      {dish.Allergens
                        .split(",")
                        .map((a) => a.trim())
                        .map((a) => (
                          <span key={a} className="inline-block mr-2">
                            {allergenIcons[a] || "‚ùó"} {a}
                          </span>
                        ))}
                    </div>
                  )}

                  {dish.Notes && (
                    <div className="text-xs text-gray-500 italic mt-1">{dish.Notes}</div>
                  )}
                </div>
              ))}
            </div>
          )}
        </div>
      ))}
    </div>
  );
}
